  false,\n\t\"url\": null,\n\t\"notes\": \"Orthophotos combine the image characteristics
  of a photograph with the geometric qualities of a map. The primary digital orthophoto
  quarter quadrangle (DOQQ) is a 1-meter ground resolution quarter-quadrangle (3.75-minutes
  of latitude by 3.75-minutes of longitude) image cast on the Universal Transverse
  Mercator Projection (UTM) on the North American Datum of 1983 (NAD83). The geographic
  extent of a DOQQ is approximate to one quarter of a standard USGS 7.5-minute quadrangle.
  This image has been clipped to the area around KNRI. The radiometric image brightness
  values are stored as 256 gray levels ranging from 0 to 255. Image data are stored
  in TIFF format and clipped to the minimum bounding rectangle for the quarter-quadrangle
  to reduce file size.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
